import React from "react";
import MusicListings from "./MusicListings"
import MusicSearch from "./MusicSearch"

function handleCards({musicInfo}){

    return (
        <div>
            <MusicSearch/>
            <MusicListings musicInfo={musicInfo}/>
        </div>
    )

}

export default handleCards;
